        people_index = people_id_list.index(person_id) + 1 if person_id in people_id_list else 1
        credit_query = f"INSERT INTO CREDIT (movie_id, people_id, department, credit_type) VALUES ({movieIds.index(movieId) + 1}, {people_index}, '{department}', '{'Crew'}');"
        sqlqueries_credit.append(credit_query)

        crew_query = f"INSERT INTO CREW (credit_id, job) VALUES ({id}, '{job.replace("'", "''")}');"
        sqlqueries_crew.append(crew_query)

        id += 1
    
